import React from 'react';
import {
  HomeIcon,
  ChartBarIcon,
  CalendarIcon,
  InboxIcon,
  ChartPieIcon
} from '@heroicons/react/24/outline';

const navigation = [
  { name: 'Dashboard', icon: HomeIcon, current: true },
  { name: 'Analytics', icon: ChartBarIcon, current: false },
  { name: 'Calendar', icon: CalendarIcon, current: false },
  { name: 'Documents', icon: InboxIcon, current: false },
  { name: 'Reports', icon: ChartPieIcon, current: false },
];

const Sidebar = () => {
  return (
    <div className="flex flex-col w-64 bg-secondary-800 h-screen">
      <div className="flex items-center justify-center h-16 px-4">
        <h1 className="text-2xl font-bold text-white">Catalyst</h1>
      </div>
      <div className="flex-1 px-3 py-4 space-y-1">
        {navigation.map((item) => (
          <a
            key={item.name}
            href="#"
            className={`
              flex items-center px-4 py-3 text-sm font-medium rounded-lg
              ${item.current
                ? 'bg-primary-600 text-white'
                : 'text-secondary-300 hover:bg-secondary-700 hover:text-white'
              }
            `}
          >
            <item.icon className="w-6 h-6 mr-3" />
            {item.name}
          </a>
        ))}
      </div>
    </div>
  );
};

export default Sidebar;
